settings\u0004Note: To disable a context:
Uwaga: Aby wyłączyć element menu kontekstowego,
skopiuj go do Preferencji Użytkownika i dodaj klucz
"disabled". Poniższy przykład wyłączy element "Pobierz" w menu plików:
{
  "contextMenu": [
    {
      "command": "filebrowser:download",
      "selector": ". p-DirListing-item[data-isdir=\"false\"]",
      "disabled": true
    }
  ]
}

