settings\u0004Note: To disable a menu or:
Uwaga: Aby wyłączyć menu lub pozycję menu,
skopiuj je do Preferencji Użytkownika i dodaj klawisz
"disabled". Poniższy przykład wyłączy
menu "Tabs" i "Zrestartuj jądro i uruchom do wybranej komórki"
element:
{
  "menu": [
    {
      "id": "jp-mainmenu-tabs",
      "disabled": true
    },
    {
      "id": "jp-mainmenu-kernel",
      "items": [
        {
          "command": "notebook:restart-and-run-to-selected",
          "disabled": true
        }
      ]
    }
  ]
}

